    data: |
      SELECT ALL * FROM tab0 (FORMAT parquet) WHERE - 45 * - + col2 / - 34 * col2 * 96 NOT BETWEEN + 75 AND + col1;
  - name: tab0

outputs:
  - name: q9612.out
    data: |
      15	81	47
      87	21	10
      97	1	99
